import { createSlice, createAsyncThunk } from "@reduxjs/toolkit";

const initialState = {
  items: {},
  status: null,
};

export const productsFetch = createAsyncThunk(
  "products/productsFetch",
  () => {}
);
export const productSlice = createSlice({
  name: "products",
  initialState,
  reducers: {},
});

export default productSlice.reducer;
